import React from 'react';
import {Menu, Container, Header} from 'semantic-ui-react';

export default ()=>{
    return(
        <Menu fixed='top' inverted style={{height:'60px'}}>
            <Container>
                <Menu.Item as='a' header>
                PollTalk
                </Menu.Item>
            </Container>
        </Menu>
    );
}
